// NavBar.js

import React from 'react';


function NavBar() {
    return (
        <nav>
            <div className="logo">
                <a href="/"> MangaKu </a>
            </div>
            <ul>
                <li><a href="/">Home</a></li>
                <li><a href="#">Lista</a></li>
                <li><button className="loginbtn" id="toggleButton" style={{ width: 'auto' }}>Cadastro/Login</button></li>
            </ul>
            <div className="menu-icon">
            <img src={'/assets/icon.png'} alt="" />            </div>
        </nav>
    );
}

export default NavBar;
